import {
  Container,
  Divider,
  Paper,
  Typography,
  Box,
  Grid,
} from "@mui/material";
import React from "react";

const AddPostPage = () => {
  return (
    <Container sx={{ paddingTop: 5, paddingLeft: 2 }}>
      <Typography sx={{ fontSize: 20 }}>Add Post</Typography>
      <Paper elevation={3}>
        <Box>
          <img
            width={400}
            height={400}
            src="https://media.istockphoto.com/id/536094265/photo/mt-rushmore-south-dakota.jpg?s=612x612&w=0&k=20&c=LHrjt7WygAarUFP_MLDALj-C0Pwd830sS7yTsR4gOoQ="
            alt="Mount Rushmore"
          />
        </Box>
        <Divider orientation="vertical" variant="middle" flexItem />
        <Grid container spacing={2}>
          <Grid item xs={6}>
            <Typography sx={{ fontSize: 16 }}>Rahul Patil</Typography>
          </Grid>
          <Grid item xs={6}>
            <Typography sx={{ fontSize: 16 }}>This is me</Typography>
          </Grid>
        </Grid>
      </Paper>
    </Container>
  );
};

export default AddPostPage;
